import { openDB } from 'idb';

class HomeServiceIDB {
  constructor() {
    this._db = null;
    this.init().then(() => {
      console.log('db initialized');
    });
  }


  async init() {
    this._db = await openDB('homes', 1, {
      async upgrade(db, oldVersion) {
        if (oldVersion === 0) {
          const store = await db.createObjectStore('homes', { keyPath: 'id' });
          await store.createIndex('owner_id', 'owner_id');
          await store.put({
            "id": "1",
            "owner_id": "1",
            "address": {
              "street": {
                "number": 4133,
                "name": "Dompvloedslaan"
              },
              "city": "Remmerden",
              "state": "Groningen",
              "country": "Netherlands",
              "postcode": "5822 EJ"
            },
            "rooms": [
              {
                "id": "1",
                "room_name": "Kitchen",
                "img": "data:image/jpeg;base64,",
                "devices": [
                  {
                    "id": "1",
                    "name": "oven",
                    "power": "250"
                  },
                  {
                    "id": "2",
                    "name": "microwave",
                    "power": "150"
                  },
                  {
                    "id": "3",
                    "name": "teapot",
                    "power": "200"
                  }
                ]
              },
              {
                "id": "2",
                "room_name": "Living Room",
                "img": "data:image/jpeg;base64,",
                "devices": [
                  {
                    "id": "1",
                    "name": "lamp",
                    "power": "100"
                  },
                  {
                    "id": "2",
                    "name": "TV",
                    "power": "150"
                  }
                ]
              },
              {
                "id": "3",
                "room_name": "Badroom",
                "img": "data:image/jpeg;base64,",
                "devices": [
                  {
                    "id": "1",
                    "name": "lamp",
                    "power": "100"
                  },
                  {
                    "id": "2",
                    "name": "lamp 2",
                    "power": "150"
                  }
                ]
              }
            ]
          });
        }
      },
    });
  }

  async db() {
    if (this._db) {
      return this._db;
    } else {
      await this.init();
      return this._db;
    }
  }

  async getHome(homeId) {
    return (await this.db()).get('homes', homeId);
  }

  async addHome(home) {
    return (await this.db()).put('homes', home);
  }

  async updateHome(home) {
    return (await this.db()).put('homes', home);
  }

  async deleteHome(id) {
    return (await this.db()).delete('homes', id);
  }
}

export default new HomeServiceIDB();
